script: |
  super -f text -I q9800.spq | sort > q9800.out

inputs:
  - name: q9800.spq
    data: |
      SELECT + + col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT + 26 * - 39 + + + col2 + + col1 + + col0 - + col2 * 0 * ( + - col0 ) * - col2 IS NOT NULL;
  - name: tab2

outputs:
  - name: q9800.out
    data: |
